import React from 'react';
import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Profile from './components/Profile/Profile';
import Dialogs from './components/Dialogs/Dialogs'
import { Route } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import MyCalendar from './components/MyCalendar/MyCalendar';
import Watchlist from './components/Watchlist/Watchlist';
import { addPost } from './redux/state';
const App = (props) => {


  return (
    <BrowserRouter>
      <div className='app-wrapper'>
        <Header />
        <Navbar />
        <div className='app-wraper-content'>

          <Route path='/Dialogs'
            render={() => <Dialogs
              dialogsData={props.state.messagesPege.dialogsData}
              messages={props.state.profile.messages} 
              dispatch={props.dispatch}
              updateNewMessage={props.updateNewMessage} 
              newMessageText={props.state.profile.newMessageText} />} />
          <Route path='/Profile'
            render={() => <Profile
              postData={props.state.messagesPege.postData}
              newPostText={props.state.messagesPege.newPostText}
              dispatch={props.dispatch} 
              updateNewPostText={props.updateNewPostText}/>} />

          <Route path='/Watchlist' render={() => <Watchlist />} />
          <Route path='/MyCalendar' render={() => <MyCalendar />} />

        </div>
      </div>
    </BrowserRouter>
  );
}



export default App;
